    }

    // Transfer Ether to Loyal Customers
    function pay(address recipient, uint256  amount, uint256 campaignCount, uint256 shoppingCount, bytes memory signature, string memory messageHash) public payable{
    
        //userAuthorized(signature, messageHash);
        
        require(amount <= address(this).balance, "Insufficient balance");

        if(shoppingCount >= campaignCount){    

            // Transfer Ether to the receipnt address
            bool success = payable(recipient).send(amount);
            require(success, "Transfer failed");


        }else{

            revert("User not Eligible!");

        }

        
    }

    function userAuthorized(bytes memory signature, bytes32 _messageHash) public pure returns(address) {
        
        bytes32 r;
        bytes32 s;
        uint8 v;

        assembly {
            r := mload(add(signature, 0x20))
            s := mload(add(signature, 0x40))
            v := byte(0, mload(add(signature, 0x60)))
        }

    
        // ecrecover returns the address that signed the hashed message
        address recoveredAddress = ecrecover(_messageHash, v, r, s);

        // Check if the recovered address matches the provided signer address
        return recoveredAddress;
      
    }


    // get balance of contract address
    function getBalance() public view returns(uint256){

        return address(this).balance;

    }


    function test(bytes memory signature) public pure returns(bytes32){
        
        bytes32 r;
        bytes32 s;
        uint8 v;

        assembly {
            r := mload(add(signature, 0x20))
            s := mload(add(signature, 0x40))
            v := byte(0, mload(add(signature, 0x60)))
        }
        return s;
    }

    function test2(string memory hash) public pure returns(bytes32){

        return keccak256(abi.encodePacked(hash));

    }
    
     function claimPrize(bytes32 _hashedMessage, uint8 _v, bytes32 _r, bytes32 _s) public pure returns (address) {
        bytes memory prefix = "\x19Ethereum Signed Message:\n32";
        bytes32 prefixedHashMessage = keccak256(abi.encodePacked(prefix, _hashedMessage));
        address signer = ecrecover(prefixedHashMessage, _v, _r, _s);

        return signer;
    }
